script: |
  super -f text -I q6706.spq | sort > q6706.out

inputs:
  - name: q6706.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 BETWEEN + 57 + + col2 AND col2 + + + 87 * col1 + + col1 * + + col1 / + ( - 20 ) + - + col0;
  - name: tab1

outputs:
  - name: q6706.out
    data: |
      51	14	96
      85	5	59
      91	47	68
